<body>
<h1>Official Home of GeorgieLabs</h1>
<h2>SoundWire Audio Communication System</h2>
<p><em>Turn your Android device into wireless headphones / wireless speaker. Stream any music or audio from your PC to your Android phone, tablet, or other PCs. SoundWire does audio mirroring (audio cast). You can use any music player on your PC or laptop like Spotify, YouTube, or iTunes and stream low-latency live sound over WiFi directly to your Android device. Also works over 3G/4G cell networks or WAN.</em>
<br>
<br>
<ul>
<li>
<p>First install the SoundWire Android app from
<a href=&amp;quot;http://play.google.com/store/apps/details?id=com.georgie.SoundWireFree&amp;quot; target=_blank>Google Play Store</a>.
<br>
</p><li>
<p>Then install the SoundWire Server on the Windows or Linux computer which is your source of music, web audio streaming, or other sounds. Click on the appropriate version below to download. After downloading run the installer. <i>You must answer yes (&amp;quot;Allow access&amp;quot;) to the Windows Firewall prompt (select both private and public networks)</i>. For the Linux versions right-click on the image and choose &amp;quot;Save Link As&amp;quot;, then untar and see the README.txt file for instructions. <b>SoundWire Server download click below:</b>
